import React from 'react';

function Food({ name, picture }) {
  return <div>
    <h2>I like {name}</h2>
    <img src={picture} />
  </div>
}

const foodILike = [
  {
    id:1,
    name: "kimchi",
    image: "a"
  },
  {
    id:2,
    name: "ramen",
    image: "b"
  },
  {
    id:3,
    name: "samgiopsal",
    image: "c"
  },
  {
    id:4,
    name: "chukumi",
    image: "d"
  }
]

function renderFood(dish) {
  return <Food name={dish.name} picture={dish.image} />
}

function App() {
  console.log(foodILike.map(renderFood));
  return (
    <div>{foodILike.map(renderFood)}</div>
  );
}

export default App;
